import pandas as pd
from scipy.spatial import distance
import numpy as np
import matplotlib.pyplot as plt


def plot_problem_data_bar(problem_list, ver):
    X_res_test = pd.read_csv('PJI_Dataset/New_data_x_test.csv', encoding='utf-8')
    all_data_list = list(X_res_test['No.Group'])
    # PID_index = no_group.index(PID)

    problem_set = set(problem_list)
    problem_list = list(problem_set)
    all_data_set = set(all_data_list)
    print(len(problem_list))

    no_problem_list = all_data_set.difference(problem_set)
    euclidean_distance_list = list()
    euclidean_distance_all = list()

    for i in problem_list:
        problem_data_index = all_data_list.index(i)
        problem_data = X_res_test.iloc[problem_data_index:problem_data_index+1]
        problem_data = problem_data.values[0]
        for j in all_data_list:
            all_data_index = all_data_list.index(j)
            all_data = X_res_test.iloc[all_data_index:all_data_index+1]
            all_data = all_data.values[0]
            euc_d = distance.euclidean(problem_data, all_data)
            euclidean_distance_list.append(euc_d)
        euclidean_distance_all.append(euclidean_distance_list)
        euclidean_distance_list = list()
    all_data_list_index = list()
    for i in range(100):
        all_data_list_index.append(i)

    for i, ID in enumerate(problem_list):
        problem_data_index = all_data_list.index(ID)
        plt.title('Problem data Index:'+str(problem_data_index)+'('+str(i)+')')
        plt.xlabel('Data index')
        plt.ylabel('Euclidean distance')
        plt.bar(all_data_list_index, euclidean_distance_all[i])
        plt.savefig('/Users/johnnyhu/Desktop/Problem_data/v'+str(ver)+'/euc_dist_' +
                    str(problem_data_index)+'.jpg')
        plt.clf()


